public void shouldIncreaseInternalBufferWhenAddingToEnd() {
  // given
  final int valueCount = 10_000;

  final Integer[] values =
      IntStream.iterate(0, (i) -> ++i)
          .limit(valueCount)
          .boxed()
          .collect(Collectors.toList())
          .toArray(new Integer[valueCount]);

