    final List<String> notFoundLines = new ArrayList<>();
    for (String expectedLine : expectedLines) {
        if (!expectedLine.isEmpty() || !expectedLine.trim().equals("}")) {
            contentLines++;
            if (actualLines.contains(expectedLine)) {
                foundLines++;
            } else {
                notFoundLines.add(expectedLine);
            }
        }
    }

