	assertThat(withMethod1.equals(withMethod1)).isTrue();
	assertThat(withMethod2.equals(withMethod2)).isTrue();
	assertThat(withMethod1.equals(withMethod2)).isTrue();
	assertThat(withMethod2.equals(withMethod1)).isTrue();

