  Assert.assertTrue(body instanceof JimpleBody);

  // Assert all local names are distinct
  Assert.assertTrue(body.getLocals().stream().map(Local::getName).distinct().count() == body.getLocalCount());

  LocalPacker.v().transform(body);

  // Assert all local names are distinct
  Assert.assertTrue(body.getLocals().stream().map(Local::getName).distinct().count() == body.getLocalCount());
}

